import React from 'react'
import PropTypes from 'prop-types'

const Movies = props => {
    return (
        <div>
            {props.movies[0].overview}
        </div>
    )
}

Movies.propTypes = {
    movies: PropTypes.object.isRequired
}

export default Movies;
